import React, { useState } from "react";
import Bin from "./Bin";
import 'bootstrap/dist/css/bootstrap.min.css';

const Header = () => {
  const [showBin, setShowBin] = useState(false);

  const handleToggleBin = () => {
    setShowBin(!showBin); // Toggles the bin
  };

  return (
    <div>
      <header className="fixed-top bg-dark text-white p-3">
        <div className="container">
          <nav className="navbar navbar-expand-lg navbar-dark">
            <a className="navbar-brand navttext" href="#top">PriceComparison</a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
              <ul className="navbar-nav">
                <li>
                  <button onClick={handleToggleBin}>
                    {showBin ? "Hide Bin" : "Show Bin"}
                  </button>
                </li>
                <li>
                  <button>Зарегистрироваться</button>
                </li>
                <li>
                  <button>Войти</button>
                </li>
              </ul>
            </div>
          </nav>
        </div>
      </header>

      {/* Conditionally render the StickyBin */}
      {showBin && <Bin />}
    </div>
  );
};

export default Header;
